import React from 'react'
import styles from './ItensLista.module.css'

export default function ItensLista({onChange, onDelete, metodo, juros, onChangeJuros}) {
  return (
    <div className={styles.container}>
        Metodo:
        <p value={metodo} onChange={onChange}></p>
        Juros:
        <p value={juros} onChange={onChangeJuros}></p>
        <button onClick={onDelete}>Deletar</button>
    </div>
  )
}
